import React from 'react';
import Paper from "@material-ui/core/Paper";



function Question({getquestionid,questions, setQuestions, index, id, upVote}) {

    const q = getquestionid(parseInt(id));
    console.log(q);

    const ups = index => {
        upVote(index);
    } 

    return(
        <Paper>
            <h1>Title: {q.title}</h1>
            <p>Question: {q.subtitle}</p>
            <p>Category: {q.category}</p>
            <p>Upvote: {q.upVote}</p>
            <button onClick={ups}>UpVote</button>
        </Paper>
    )
}

export default Question;
